import React, {Component} from 'react';
import '../styles/App.css';

class App extends Component{
  render(){
    return (
      <div onClick={this.props.onClick}>This app is for comparing laws. This text has been pressed {this.props.clicks} times.</div>
    );
  }
}

export default App;
